import React from "react";

function CreateBlogs() {
  return (
    <>
      <form>
        Title:
        <input type="text" name="Title" placeholder="Enter your title" />
        Description:
        <input type="textarea" name="Title" placeholder="Enter your title" />
      </form>
    </>
  );
}

export default CreateBlogs;
